<?php $__env->startSection('content'); ?><p>It's two weeks in and the first celebrity - Charles Oakley - has been sent home.</p>

<p>And the remaining 14 contestants were back hard at work on Thursday as Dancing With The Stars rehearsals continued in full swing.</p>

<p>Selling Sunset's Chrishell Stause turned heads as she arrived at the dance studio in a sleeveless crop top and flowing skirt.</p>

<p>Ready to rumba: Selling Sunset's Chrishell Stause was among the celebrity contestants who headed to rehearsals in LA on Thursday ahead of week three of ABC's Dancing With The Stars</p>

<p>Chrishell, 39, and pro partner Gleb Savchenko have logged a total of 31 points out of a possible 60 so far in the ABC reality show.</p>

<p>In an interview with Good Morning America on Tuesday, Chrishell, who is going through a divorce from This Is Us actor Justin Hartley, described being on DWTS as 'one of the scariest things I've ever done.'</p>

<p>She added: 'I couldn't have imagined how immersive and all-encompassing this show was before. When you aren't dancing, you are thinking about dancing.' </p>

<p>Lovely look: Chrishell, 39, turned heads in a sleeveless crop top that showcased her cleavage and a flowing animal print midi skirt with buttons down the front</p>

<p>Challenge: In an interview with GMA, Chrishell, who is going through a divorce from This Is Us actor Justin Hartley, described being on DWTS as 'one of the scariest things I've ever done'</p>

<p>Working through the pain: The Bachelorette alum Kaitlyn Bristowe arrived for rehearsals with a brace on her injured ankle and wearing a cute cropped top with sweats rolled up to the knee</p>

<p>Injured: The reality star, 35, only participated in Tuesday's live show after being given the all-clear by medics. She shared via Instagram Thursday she'd had a MRI before rehearsals</p>

<p>The Bachelorette alum Kaitlyn Bristowe arrived for rehearsals with a brace on her injured ankle.</p>

<p>The reality star hurt herself during rehearsals ahead of Tuesday's live show and only participated after being given the all-clear by medics.</p>

<p>Still, that hadn't stopped her and pro partner Artem Chigvintsev from delivering a judge-pleasing foxtrot that left them tied for first place at 42 points with Justina Machado and her partner Sasha Farber.</p>

<p>Before Thursday evening's practice session, Kaitlyn, 35, had shared via social media that she was having a MRI on her ankle.</p>

<p>'Yesterday was kind of a write off for me because I was just in pain and kept my foot elevated and just did nothing all day yesterday,' she shared on Instagram.  </p>

<p>'I don't want to seem like a baby because I know so many people go through injuries on this show, and battle through, and that's what I want to do. But i just want to keep everyone posted,' she explained.</p>

<p>Keeping connected: Justina Machado, who is currently tied for first place in the reality competition, chatted on her phone through a pink face mask as she headed into rehearsals</p>

<p>Relaxed: The actress, 48, was casual in a sleeveless black top with spaghetti straps and baggy blue jeans with white sneakers</p>

<p>Upbeat: Carole Baskin, star of Netflix's docuseries Tiger King, didn't seem deterred by almost being eliminated from the competition on Tuesday and looked happy to be back at the studio</p>

<p>Tiger King star: The 59-year-old is milking her big cat credentials, showing up in a themed headband, mask and backpack, and performing to Eye Of The Tiger and What's New Pussycat?</p>

<p>Carole Baskin didn't seem deterred by almost being eliminated from the competition on Tuesday after scoring the same number of points as former NBA star Oakley.</p>

<p>The judges, however, decided to save the star of Netflix's Tiger King, who's partnered with pro Pasha Pashkov, and let her dance another day.</p>

<p>The co-founder of Florida's Big Cat rescue is milking her big cat connection for all it's worth on DWTS, performing the first week to Survivor's Eye Of The Tiger and in week two, dancing to Tom Jones's hit What's New Pussycat?</p>

<p>Actress Anne Heche arrived at the rehearsal studio wearing a flowing pink patterned dress with a cinched waist and buttons down the front.</p>

<p>The 51-year-old, whose stated goal is not to embarrass her sons Atlas, 11, and Homer, 18, appeared upbeat as she joined her pro partner Keo Motsepe.</p>

<p>After their session, the two snapped a selfie together before Heche headed off in a her green Mini Cooper Convertible.</p>

<p>Other celebrity contestants spotted at the rehearsal studios included actor Jesse Metcalfe, Disney star Skai Jackson, former football tight end Vernon Davis, Catfish host Nev Schulman and Olympic figure skater Johnny Weir.</p>

